--
-- Create function `CreateNewCode`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION CreateNewCode ()
RETURNS varchar(20) CHARSET utf8mb4
DETERMINISTIC
COMMENT 'Function tạo employeeCode mới tự tăng'
BEGIN
  DECLARE lastestCode varchar(20);

  SELECT
    e.EmployeeCode INTO lastestCode
  FROM employee e
  ORDER BY e.EmployeeCode DESC
  LIMIT 1;

  SET @number = SUBSTRING(lastestCode, 3);
  SET @newCode = CONCAT('NV', @number + 1);
  RETURN @newCode;
END
$$

