CREATE DEFINER = 'root'@'localhost'
PROCEDURE GetEmployeesPaging (IN $skip int, IN $take int, IN $where text, IN $sort varchar(255))
COMMENT 'PROC lấy thông tin nhân viên theo phân trang'
BEGIN
  CREATE TEMPORARY TABLE IF NOT EXISTS `tmp_employee` (
    EmployeeID char(36),
    EmployeeCode varchar(20),
    EmployeeName varchar(100),
    Gender tinyint,
    PhoneNumber varchar(20),
    DateOfBirth date,
    Email varchar(255),
    DepartmentName varchar(255),
    PositionName varchar(100),
    Salary decimal(18, 4),
    WorkStatus tinyint,
    Image text,
    DepartmentID char(36),
    PositionID char(36)
  );

  -- Insert dữ liệu tương ứng vào bảng tạm temp_employee
  -- Lưu ý khi lấy dữ liệu trên list thì phòng ban và vị trí chỉ lấy thông tin tên phòng ban, tên vị trí nên phải join sang bảng `positions` và `department` để lấy thông tin
    SELECT
      e.EmployeeID,
      e.EmployeeCode,
      e.EmployeeName,
      e.Gender,
      e.PhoneNumber,
      e.DateOfBirth,
      e.Email,
      d.DepartmentName,
      p.PositionName,
      e.Salary,
      e.WorkStatus,
      e.Image,
      e.DepartmentID,
      e.PositionID
    FROM `employee` e
      LEFT JOIN `department` d
        ON e.DepartmentID = d.DepartmentID
      LEFT JOIN `positions` p
        ON e.PositionID = p.PositionID
    ORDER BY e.ModifiedDate DESC;

  #Phân trang
  -- Nếu như không có điều kiện query truyền vào thì gán 1=1 (điều kiện này luôn đúng - đây là 1 cách để set điều kiện query mặc định)
  IF IFNULL($Where, '') = '' THEN
    SET $Where = '1=1';
  END IF;

  --   IF IFNULL($Sort, '') = '' THEN
  --     SET $Sort = 'DESC'; -- Hiện tại đang để default sắp xếp theo mã nhân viên giảm dần (có thể edit để thay đổi sắp xếp theo yêu cầu đề bài)
  --   END IF;
  IF $Take = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM `tmp_employee` WHERE ', $Where); -- Mặc định truyền -1 => Nếu truyền -1 sẽ lấy toàn bộ bản ghi
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM `tmp_employee` WHERE ', $Where, ' LIMIT ', $Skip, ', ', $Take); -- Nếu lấy dữ liệu trên 1 page có truyền skip, take vào thì sẽ lấy số lượng bản ghi tương ứng trên page
  END IF;

  -- Có thể để ý thấy trên yêu cầu đề bài sẽ không chỉ lấy ra thông tin nhân viên trên page mà còn lấy ra tổng số bản ghi trên toàn bộ các page
  -- Vậy nên có thể hiểu là dữ liệu mong muốn trả về trong store này là 2 dữ liệu: Thông tin nhân viên + Tổng số bản ghi
  -- => Sử dụng phương pháp execute query để trả về 2 thông tin trong cùng 1 store
  PREPARE stmt1 FROM @filterQuery;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

  SET @filterQuery = CONCAT('SELECT count(EmployeeID) AS TotalCount FROM `tmp_employee` WHERE ', $Where);
  PREPARE stmt1 FROM @filterQuery;
  EXECUTE stmt1;
  DEALLOCATE PREPARE stmt1;

  -- Drop temp table đi sau khi dùng xong để giải phóng dữ liệu
  DROP TEMPORARY TABLE `tmp_employee`;
END
$$

