--
-- Create trigger `Trigger_InsertEmployee`
--
CREATE
DEFINER = 'root'@'localhost'
TRIGGER Trigger_InsertEmployee
BEFORE INSERT
ON employee
FOR EACH ROW
BEGIN
  SET @nickname = SUBSTRING_INDEX (NEW.Email, '@', 1);
  SET @footer = SUBSTRING_INDEX (NEW.Email, '@', -1);

  -- Kiếm tra định dạng email
  IF @nickname = NULL
    OR @footer <> 'gmail.com' THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Department "Sale" cannot add more user';
  END IF;

  SET @DateOfBirth = NEW.DateOfBirth;
  SET @IdentifyIssuedDate = NEW.IdentifyIssuedDate;
  SET @JoinDate = NEW.JoinDate;

  -- Kiểm tra date không được lớn hơn ngày tháng hiện tại
  IF @DateOfBirth > DATE(NOW())
    || @IdentifyIssuedDate > DATE(NOW())
    || @JoinDate > DATE(NOW()) THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Department "Sale" cannot add more user';
  END IF;
END
$$

